INSERT INTO `album` (`albumTitle`, `albumYear`, `numSongs`, `albumGenre`, `albumPrice`, `albumImg`, `albumDescrip`) VALUES
('ARTPOP', '2013-11-11', 15, 'Pop/Rock', 35, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/672/MI0003672873.jpg?partner=allrovi.com', '<p> If <a class="album-link" href="http://www.allmusic.com/album/born-this-way-mw0002132518">Born This Way</a> was made for the Little Monsters, its 2013 sequel <a class="album-link" href="http://www.allmusic.com/album/artpop-mw0002573777">ARTPOP</a> was made for the world. <a class="name-link" href="http://www.allmusic.com/artist/lady-gaga-mn0000994823">Lady Gaga</a> has grand designs for her third album, to pull a "reverse Warhol," which presumably means she wants to channel high art into pop instead of pop into high art, but it''s a little difficult to discern <a class="name-link" href="http://www.allmusic.com/artist/gaga-mn0000994823">Gaga</a> ''s intent, either in this statement or <a class="album-link" href="http://www.allmusic.com/album/artpop-mw0002573777">ARTPOP</a> as a whole. Willfully existing simply on the surface, a surface that perhaps (or perhaps not) signifies a greater depth, <a class="album-link" href="http://www.allmusic.com/album/artpop-mw0002573777">ARTPOP</a> is teasingly garish, its bright colors and brittle beats attacking wi'),
('Back to Basics', '2006-08-15', 23, 'Pop/Rock,R&B,', 39, 'http://cps-static.rovicorp.com/3/JPG_400/MI0001/985/MI0001985088.jpg?partner=allrovi.com', '<p> When <a class="name-link" href="http://www.allmusic.com/artist/christina-aguilera-mn0000780258">Christina Aguilera</a> released her garish, sexually charged sophomore effort, <a class="album-link" href="http://www.allmusic.com/album/stripped-mw0000662221">Stripped</a> , in 2002, it seemed that she pushed her obsessions with tweaking taboos just a little too far. Sure, she could still sing, but her music was now driven entirely by skeletal club grooves and explicit carnality. It was a bold break from the teenybopper persona she was desperate to shed, but it was overcorrective steering, taking her a little bit too far down the road toward a grotesque caricature, particularly in her ugly video for the album''s lead single, "Dirrty." All this grandstanding provoked an intense reaction, not just among fans but among her collaborators, who also wondered if <a class="name-link" href="http://www.allmusic.com/artist/christina-mn0000780258">Christina</a> was going a little too far, but she managed to keep from sinking largely on the strength of the ballad'),
('Believe Acoustic', '2013-01-29', 11, 'Pop/Rock,', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/483/MI0003483473.jpg?partner=allrovi.com', '<p> Like <a class="album-link" href="http://www.allmusic.com/album/my-worlds-acoustic-mw0002076557">My Worlds Acoustic</a> before it, <a class="album-link" href="http://www.allmusic.com/album/believe-acoustic-mw0002476550">Believe Acoustic</a> maintains the flow of <a class="name-link" href="http://www.allmusic.com/artist/bieber-mn0002165952">Bieber</a> product following a proper studio album. It features eight acoustic versions of songs from <a class="album-link" href="http://www.allmusic.com/album/believe-mw0002357910">Believe</a> , as well as three new songs. Studio musicians do most of the instrumental work, but <a class="name-link" href="http://www.allmusic.com/artist/bieber-mn0002165952">Bieber</a> is credited with some guitar on a couple tracks. The playful side of <a class="album-link" href="http://www.allmusic.com/album/believe-mw0002357910">Believe</a> is not well-suited for earnest, stripped-down renderings. Party anthems like "Beauty and a Beat" and lines like "Chillin'' by the fire while we eatin'' fondue," from "Boyfriend," seem silly w'),
('Born This Way', '2011-05-23', 14, 'Pop/Rock', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/178/MI0003178069.jpg?partner=allrovi.com', '<p> Not long into the ceaseless promotional parade for <a class="album-link" href="http://www.allmusic.com/album/born-this-way-mw0002132518">Born This Way</a> , <a class="name-link" href="http://www.allmusic.com/artist/lady-gaga-mn0000994823">Lady Gaga</a> _?_s second full-length record and easily the most anticipated record of the 2010s, a certain sense of inevitability crept into play. It was inevitable that <a class="album-link" href="http://www.allmusic.com/album/born-this-way-mw0002132518">Born This Way</a> would be an escalation of <a class="album-link" href="http://www.allmusic.com/album/the-fame-mw0001327294">The Fame</a> , it was inevitable that <a class="name-link" href="http://www.allmusic.com/artist/gaga-mn0000994823">Gaga</a> would go where others feared to tread, it was inevitable that it would be bigger than any other record thrown down in 2011, both in its scale and success. This drumbeat, pulsating as insistently as Eurodisco, is so persistent that there is an inevitable feeling of anticlimax upon hearing <a class="album-link" href'),
('Celebration Day', '2012-11-19', 16, 'Pop/Rock,', 53.5, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/444/MI0003444168.jpg?partner=allrovi.com', '<p> Contrary to popular perception, <a class="name-link" href="http://www.allmusic.com/artist/led-zeppelin-mn0000139026">Led Zeppelin</a> isn''t exactly averse to reunions. If anything, <a class="name-link" href="http://www.allmusic.com/artist/jimmy-page-mn0000089021">Jimmy Page</a> and <a class="name-link" href="http://www.allmusic.com/artist/robert-plant-mn0000830538">Robert Plant</a> can''t keep away from each other. Just four years after <a class="name-link" href="http://www.allmusic.com/artist/john-bonham-mn0000218777">John Bonham</a> ''s 1980 death, <a class="name-link" href="http://www.allmusic.com/artist/page-mn0000089021">Page</a> laid down guitar on <a class="name-link" href="http://www.allmusic.com/artist/robert-plant-mn0000830538">Robert Plant</a> ''s oldies act <a class="name-link" href="http://www.allmusic.com/artist/the-honeydrippers-mn0000075473">the Honeydrippers</a> , and not long after that, <a class="name-link" href="http://www.allmusic.com/artist/john-paul-jones-mn0000231997">John Paul Jones</a> joined the pair for a performance at'),
('Come Away with Me', '2002-02-26', 14, 'Pop/Rock,Jazz,Vocal,', 39, 'http://cps-static.rovicorp.com/3/JPG_400/MI0001/555/MI0001555072.jpg?partner=allrovi.com', '<p> <a class="name-link" href="http://www.allmusic.com/artist/norah-jones-mn0000884686">Norah Jones</a> '' debut on Blue Note is a mellow, acoustic pop affair with soul and country overtones, immaculately produced by the great <a class="name-link" href="http://www.allmusic.com/artist/arif-mardin-mn0000595559">Arif Mardin</a> . (It''s pretty much an open secret that the 22-year-old vocalist and pianist is the daughter of <a class="name-link" href="http://www.allmusic.com/artist/ravi-shankar-mn0000404463">Ravi Shankar</a> .) <a class="name-link" href="http://www.allmusic.com/artist/jones-mn0000884686">Jones</a> is not quite a jazz singer, but she is joined by some highly regarded jazz talent: guitarists <a class="name-link" href="http://www.allmusic.com/artist/adam-levy-mn0001941557">Adam Levy</a> , <a class="name-link" href="http://www.allmusic.com/artist/adam-rogers-mn0000928480">Adam Rogers</a> , <a class="name-link" href="http://www.allmusic.com/artist/tony-scherr-mn0000130227">Tony Scherr</a> , <a class="name-link" href="http://www.allmusic.com/ar'),
('Cookin'' in Mobile', '2010-06-28', 26, 'Blues,', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/161/MI0003161609.jpg?partner=allrovi.com', '<p> <a class="name-link" href="http://www.allmusic.com/artist/robert-cray-mn0000830425">Robert Cray</a> is a dependable, professional performer who has been criticized for being too reserved on-stage. He loosens his tie on this set though, recorded at a single show in February 2010. The veteran frontman tears into his staccato guitar solos with gusto here, extending the tunes and singing with a rawness often lacking in his studio work. His band also pushes harder, especially longtime keyboardist/songwriter <a class="name-link" href="http://www.allmusic.com/artist/jim-pugh-mn0000074339">Jim Pugh</a> , whose featured solos match <a class="name-link" href="http://www.allmusic.com/artist/cray-mn0000830425">Cray</a> ''s own intensity and are spotlighted throughout. This is soul-bluesman <a class="name-link" href="http://www.allmusic.com/artist/cray-mn0000830425">Cray</a> ''s third live release in four years (2010''s <a class="album-link" href="http://www.allmusic.com/album/authorized-bootleg-mw0001980946">Authorized Bootleg</a> dated back to a 1987 show), '),
('Do What U Want', '2013-10-22', 1, 'Electronic', 43.56, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/667/MI0003667726.jpg?partner=allrovi.com', ''),
('Fearless', '2008-11-11', 15, 'Country,Pop/Rock,', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0000/836/MI0000836639.jpg?partner=allrovi.com', '<p> <a class="name-link" href="http://www.allmusic.com/artist/taylor-swift-mn0000472102">Taylor Swift</a> abandons any pretense that she''s a teen on her second album, <a class="album-link" href="http://www.allmusic.com/album/fearless-mw0000813082">Fearless</a> -- which isn''t to say that she suddenly tarts herself up, running away from her youth in a manner that''s all too familiar to many teen stars. <a class="name-link" href="http://www.allmusic.com/artist/swift-mn0000472102">Swift</a> ''s maturation is deliberate and careful, styled after the crossover country-pop of <a class="name-link" href="http://www.allmusic.com/artist/shania-twain-mn0000161808">Shania Twain</a> and <a class="name-link" href="http://www.allmusic.com/artist/faith-hill-mn0000162269">Faith Hill</a> before they turned into divas. Despite the success of her self-titled 2006 debut, there''s nothing at all diva-like about <a class="name-link" href="http://www.allmusic.com/artist/swift-mn0000472102">Swift</a> on 2008''s <a class="album-link" href="http://www.allmusic.com/album/fearless-'),
('Full Frequency', '2014-02-17', 14, 'Reggae,', 45.78, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/686/MI0003686408.jpg?partner=allrovi.com', '<p> While his 2012 effort <a class="album-link" href="http://www.allmusic.com/album/tomahawk-technique-mw0002298749">Tomahawk Technique</a> recast dancehall singer <a class="name-link" href="http://www.allmusic.com/artist/sean-paul-mn0000264350">Sean Paul</a> as Jamaica''s leading EDM artist, 2014''s <a class="album-link" href="http://www.allmusic.com/album/full-frequency-mw0002585309">Full Frequency</a> injects some hip-hop and <a class="name-link" href="http://www.allmusic.com/artist/marley-mn0000951374">Marley</a> back into the mix, and all for the better. The <a class="name-link" href="http://www.allmusic.com/artist/marley-mn0000951374">Marley</a> happens to be <a class="name-link" href="http://www.allmusic.com/artist/bob-mn0000071514">Bob</a> ''s son <a class="name-link" href="http://www.allmusic.com/artist/junior-gong-damian-mn0000951374">"Junior Gong" Damian</a> , a wise choice for some raw mashing it up and reclaiming reggae cred; cred which is certainly earned during their opening collaboration "Riot," a worthy "Welcome to Jamrock"-styled num'),
('FutureSex/LoveSounds', '2006-09-12', 12, 'Pop/Rock,', 16.5, 'http://cps-static.rovicorp.com/3/JPG_400/MI0000/728/MI0000728878.jpg?partner=allrovi.com', '<p> Give <a class="name-link" href="http://www.allmusic.com/artist/justin-timberlake-mn0000312890">Justin Timberlake</a> credit for this: he has ambition. He may not have good instincts and may bungle his execution, but he sure has ambition and has ever since he was the leading heartthrob in <a class="name-link" href="http://www.allmusic.com/artist/nsync-mn0000516929">*NSYNC</a> . He drove the teen pop quintet to the top of the charts, far exceeding their peers <a class="name-link" href="http://www.allmusic.com/artist/the-backstreet-boys-mn0000765595">the Backstreet Boys</a> , and when the group could achieve no more, he eased into a solo career that earned him great sales and a fair amount of praise, largely centered on how he reworked the dynamic sound of early <a class="name-link" href="http://www.allmusic.com/artist/michael-jackson-mn0000467203">Michael Jackson</a> at a time when Jacko was so hapless he turned away songs that later became JT hits, as in the <a class="name-link" href="http://www.allmusic.com/artist/neptunes-mn0000401903">Neptune'),
('Get Up!', '2013-01-29', 10, 'Blues,Pop/Rock,', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/463/MI0003463939.jpg?partner=allrovi.com', '<p> This musical hookup between these two experienced roots artists who have more in common than it seems at first glance, is a natural evolution for both. <a class="name-link" href="http://www.allmusic.com/artist/ben-harper-mn0000792733">Ben Harper</a> seemed like an old soul, even when he began his career, dipping into classic R&amp;B, gospel, and blues but spinning them through his dark, folk-funk persona. His work with <a class="name-link" href="http://www.allmusic.com/artist/the-blind-boys-of-alabama-mn0000568725">the Blind Boys of Alabama</a> showed him to be welcomed by veteran artists who clearly felt he was a kindred spirit. Harpist/guitarist <a class="name-link" href="http://www.allmusic.com/artist/charlie-musselwhite-mn0000211627">Charlie Musselwhite</a> ''s extensive r??sum?? typically moved him past the often limiting structure of the Chicago blues where he first made his presence felt, to Tex-Mex, Cuban, Americana, swamp rock, country, and even jazz. The two connected on a 1997 <a class="name-link" href="http://www.allmusic.com/artist/'),
('Global Warming', '2012-11-19', 12, 'Latin,Rap,', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/462/MI0003462748.jpg?partner=allrovi.com', '<p> With his label, J Records, closing shop, Miami rapper <a class="name-link" href="http://www.allmusic.com/artist/pitbull-mn0000350685">Pitbull</a> moves to RCA proper for <a class="album-link" href="http://www.allmusic.com/album/global-warming-mw0002349062">Global Warming</a> , a high-octane, well-funded party album that needs a bit of trimming to be considered officially "non-stop." It''s the polished ballads that are the arguable snares, as the <a class="name-link" href="http://www.allmusic.com/artist/chris-brown-mn0000266063">Chris Brown</a> feature "Hope We Meet Again" offers a pleasing, "one for the ladies" number at half the usual speed, and while it might be a worthwhile attempt to round out the album, it''s surrounded by tracks that party like a speedy, overcrowded boat on Miami seas with "bottle service or die!" painted on the side. Put the BPMs in the right order and this could be the ultimate <a class="name-link" href="http://www.allmusic.com/artist/pitbull-mn0000350685">Pitbull</a> mix CD, which Mr. 305 himself would seem to prefer at '),
('Keeps Gettin'' Better', '2008-11-03', 1, 'Pop/Rock,', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0001/843/MI0001843286.jpg?partner=allrovi.com', ''),
('Like a Prayer', '2009-11-24', 11, 'Pop/Rock,Electronic,', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/566/MI0003566340.jpg?partner=allrovi.com', '<p> Out of all of <a class="name-link" href="http://www.allmusic.com/artist/madonna-mn0000237205">Madonna</a> ''s albums, <a class="album-link" href="http://www.allmusic.com/album/like-a-prayer-mw0000198738">Like a Prayer</a> is her most explicit attempt at a major artistic statement. Even though it is apparent that she is trying to make a "serious" album, the kaleidoscopic variety of pop styles on <a class="album-link" href="http://www.allmusic.com/album/like-a-prayer-mw0000198738">Like a Prayer</a> is quite dazzling. Ranging from the deep funk of "Express Yourself" and "Keep It Together" to the haunting "Oh Father" and "Like a Prayer," <a class="name-link" href="http://www.allmusic.com/artist/madonna-mn0000237205">Madonna</a> displays a commanding sense of songcraft, making this her best and most consistent album. </p>'),
('Like a Virgin', '1984-11-12', 10, 'Pop/Rock,Electronic,', 88.2, 'http://cps-static.rovicorp.com/3/JPG_400/MI0001/830/MI0001830281.jpg?partner=allrovi.com', '<p> <a class="name-link" href="http://www.allmusic.com/artist/madonna-mn0000237205">Madonna</a> had hits with her first album, even reaching the Top Ten twice with "Borderline" and "Lucky Star," but she didn''t become a superstar, an icon, until her second album, <a class="album-link" href="http://www.allmusic.com/album/like-a-virgin-mw0000190879">Like a Virgin</a> . She saw the opening for this kind of explosion and seized it, bringing in former <a class="name-link" href="http://www.allmusic.com/artist/chic-mn0000092942">Chic</a> guitarist <a class="name-link" href="http://www.allmusic.com/artist/nile-rodgers-mn0000411830">Nile Rodgers</a> in as a producer, to help her expand her sound, and then carefully constructed her image as an ironic, ferociously sexy Boy Toy; the <a class="name-link" href="http://www.allmusic.com/artist/steven-meisel-mn0001759311">Steven Meisel</a> -shot cover, capturing her as a buxom bride with a Boy Toy belt buckle on the front, and dressing after a night of passion, was as key to her reinvention as the music itself. Yet,'),
('Live', '2008-02-19', 12, 'Blues,', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0002/489/MI0002489587.jpg?partner=allrovi.com', '<p> Recorded in the fall of 2006, shortly after <a class="name-link" href="http://www.allmusic.com/artist/bb-king-mn0000059156">B.B. King</a> ''s 81st birthday, <a class="album-link" href="http://www.allmusic.com/album/live-mw0000580180">Live</a> is really an abridged audio complement to a video release, containing 12 of the 19 tracks available on the DVD of the same title. <a class="name-link" href="http://www.allmusic.com/artist/king-mn0000059156">King</a> has made a lot of live albums in his time, but his approach hasn''t changed much over the years. In addition to his obvious talents as a guitarist and showman, he has also been fortunate in that his chosen style of music, a version of the blues growing out of the swing-influenced jump blues of the 1940s, has not only remained perennially popular but grown in acceptance. As performed here by <a class="name-link" href="http://www.allmusic.com/artist/the-bb-king-blues-band-mn0002089320">the B.B. King Blues Band</a> , it is still essentially the same, a jazzy roadhouse music that leaves plenty of roo'),
('Live at the Regal', '2009-11-24', 10, 'Blues,R&B,', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0002/488/MI0002488779.jpg?partner=allrovi.com', '<p>B.B. King is not only a timeless singer and guitarist, he''s also a natural-born entertainer, and on Live at the Regal the listener is treated to an exhibition of all three of his talents. Over percolating horn hits and rolling shuffles, King treats an enthusiastic audience (at some points, they shriek after he delivers each line) to a collection of some of his greatest hits. The backing band is razor-sharp, picking up the leader''s cues with almost telepathic accuracy. King''s voice is rarely in this fine of form, shifting effortlessly between his falsetto and his regular range, hitting the microphone hard for gritty emphasis and backing off in moments of almost intimate tenderness. Nowhere is this more evident than at the climax of "How Blue Can You Get," where the Chicago venue threatens to explode at King''s prompting. Of course, the master''s guitar is all over this record, and his playing here is among the best in his long career. Displaying a jazz sensibility, King''s lines are sophisticated without losing their grit. More than anything else, L'),
('Live at the Royal Albert Hall 2011', '2012-03-20', 10, 'Blues,', 45, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/311/MI0003311226.jpg?partner=allrovi.com', '<p> He may be 85 these days, but <a class="name-link" href="http://www.allmusic.com/artist/bb-king-mn0000059156">B.B. King</a> is still <a class="name-link" href="http://www.allmusic.com/artist/bb-king-mn0000059156">B.B. King</a> , and any time he sings or delivers those signature clean, jazzy, and warm guitar lines, it''s an extra gift from a musician who has given us listeners and fans so much for so long. This warm, celebratory, and good-natured live set was recorded on June 28, 2011 at London''s Royal Albert Hall and features <a class="name-link" href="http://www.allmusic.com/artist/king-mn0000059156">King</a> in chatty good humor and a whole host of guests, including guitarist <a class="name-link" href="http://www.allmusic.com/artist/derek-trucks-mn0000202162">Derek Trucks</a> , singer <a class="name-link" href="http://www.allmusic.com/artist/susan-tedeschi-mn0000043520">Susan Tedeschi</a> , <a class="name-link" href="http://www.allmusic.com/artist/the-rolling-stones-mn0000894465">the Rolling Stones</a> '' <a class="name-link" href="http://www.al'),
('Live from the Montreal International Jazz Festival', '2010-03-09', 31, 'Pop/Rock,', 56.3, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/132/MI0003132405.jpg?partner=allrovi.com', '<p> <a class="name-link" href="http://www.allmusic.com/artist/ben-harper-mn0000792733">Ben Harper</a> is no stranger to live albums. This is his sixth. That said, it is the first with the <a class="name-link" href="http://www.allmusic.com/artist/relentless-7-mn0001069634">Relentless 7</a> , an Austin TX-based trio <a class="name-link" href="http://www.allmusic.com/artist/harper-mn0000792733">Harper</a> hooked up with to record the stellar <a class="album-link" href="http://www.allmusic.com/album/white-lies-for-dark-times-mw0000816217">White Lies for Dark Times</a> . Basically, this CD/DVD package is a support gig for the <a class="album-link" href="http://www.allmusic.com/album/white-lies-mw0000816217">White Lies</a> album. The songs from it -- and a few others -- have been lived in for a while, and the band''s internal communication language has developed to the instinctual level. The interplay between between <a class="name-link" href="http://www.allmusic.com/artist/harper-mn0000792733">Harper</a> and <a class="name-link" href="http://www.allmusic'),
('Lotus', '2012-11-12', 13, 'Pop/Rock,', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/460/MI0003460974.jpg?partner=allrovi.com', '<p> Considering all the trials and tribulations surrounding her 2010 album <a class="album-link" href="http://www.allmusic.com/album/bionic-mw0001989957">Bionic</a> , <em>Phoenix</em> may have been a more appropriate title for <a class="name-link" href="http://www.allmusic.com/artist/christina-aguilera-mn0000780258">Christina Aguilera</a> ''s fifth album than <a class="album-link" href="http://www.allmusic.com/album/lotus-mw0002427099">Lotus</a> . Plagued by delays, <a class="album-link" href="http://www.allmusic.com/album/bionic-mw0001989957">Bionic</a> underwhelmed upon its 2010 release, as did <a class="name-link" href="http://www.allmusic.com/artist/xtina-mn0000780258">Xtina</a> ''s silver screen debut Burlesque, and her career appeared on the brink of meltdown until she signed up to be a voice on the NBC singing competition <em>The Voice</em> . Soon, she was duetting with her co-star <a class="name-link" href="http://www.allmusic.com/artist/adam-levine-mn0000594853">Adam Levine</a> on <a class="name-link" href="http://www.allmusic.com/artist/mar'),
('Makin'' Love Is Good for You', '2000-04-25', 14, 'Blues,Pop/Rock,', 22, 'http://cps-static.rovicorp.com/3/JPG_400/MI0002/163/MI0002163712.jpg?partner=allrovi.com', '<p> Over the years, the music world has seen its share of over-70 singers who kept performing even though they didn''t have much of a voice left: Peggy Lee and <a class="name-link" href="http://www.allmusic.com/artist/frank-sinatra-mn0000792507">Frank Sinatra</a> are among the names that come to mind. But when <a class="name-link" href="http://www.allmusic.com/artist/bb-king-mn0000059156">B.B. King</a> entered his 70s, the veteran blues singer/guitarist could still belt it out with confidence, and he does exactly that on <a class="album-link" href="http://www.allmusic.com/album/makin-love-is-good-for-you-mw0000061470">Makin'' Love Is Good for You</a> , which was recorded when <a class="name-link" href="http://www.allmusic.com/artist/king-mn0000059156">King</a> was 74. Although this blues/soul effort won''t go down in history as one of his all-time classics, it''s a respectable CD that finds his voice continuing to hold up well. <a class="name-link" href="http://www.allmusic.com/artist/king-mn0000059156">King</a> ''s charisma remains, and he has no probl'),
('MDNA', '2012-03-16', 12, 'Pop/Rock,Electronic,', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/328/MI0003328848.jpg?partner=allrovi.com', '<p> Most pop stars reach a point where they accept the slow march of time, but not <a class="name-link" href="http://www.allmusic.com/artist/madonna-mn0000237205">Madonna</a> . Time is <a class="name-link" href="http://www.allmusic.com/artist/madonna-mn0000237205">Madonna</a> ''s enemy -- an enemy to be battled or, better still, one to be ignored. She soldiers on, turning tougher, harder, colder with each passing album, winding up with a record as flinty as <a class="album-link" href="http://www.allmusic.com/album/mdna-mw0002311480">MDNA</a> , the 2012 record that is her first release since departing Warner for Interscope. That''s hardly the only notable shift in <a class="name-link" href="http://www.allmusic.com/artist/madonna-mn0000237205">Madonna</a> ''s life since the 2008 release of <a class="album-link" href="http://www.allmusic.com/album/hard-candy-mw0000782718">Hard Candy</a> . Since then, she has divorced film director <a class="name-link" href="http://www.allmusic.com/artist/guy-ritchie-mn0001015924">Guy Ritchie</a> and has seen her ''80s per'),
('Not Too Late', '2007-01-30', 13, 'Pop/Rock,Jazz,', 50.12, 'http://cps-static.rovicorp.com/3/JPG_400/MI0000/743/MI0000743351.jpg?partner=allrovi.com', '<p> Recoils from fame usually aren''t as subdued as <a class="name-link" href="http://www.allmusic.com/artist/norah-jones-mn0000884686">Norah Jones</a> '' third album, <a class="album-link" href="http://www.allmusic.com/album/not-too-late-mw0000448615">Not Too Late</a> , but such understatement is customary for this gentlest of singer/songwriters. <a class="album-link" href="http://www.allmusic.com/album/not-too-late-mw0000448615">Not Too Late</a> may not be as barbed or alienating as either <a class="album-link" href="http://www.allmusic.com/album/in-utero-mw0000097301">In Utero</a> or <a class="album-link" href="http://www.allmusic.com/album/kid-a-mw0000620999">Kid A</a> -- it''s not an ornery intensification of her sound nor a chilly exploration of its furthest limits -- but make no mistake, it is indeed a conscious abdication of her position as a comfortable coffeehouse crooner and a move toward art for art''s sake. And, frankly, who can blame <a class="name-link" href="http://www.allmusic.com/artist/jones-mn0000884686">Jones</a> for wanting to sha'),
('Nothin But Love', '2012-08-27', 11, 'Blues,Pop/Rock,', 32, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/425/MI0003425875.jpg?partner=allrovi.com', '<p> The differences in <a class="name-link" href="http://www.allmusic.com/artist/robert-cray-mn0000830425">Robert Cray</a> albums are subtle but noticeable to fans of the veteran soul-bluesman. He retains the same backing trio on this 2012 release as on 2009''s studio disc, with the only major difference in personnel being the addition of noted roots producer <a class="name-link" href="http://www.allmusic.com/artist/kevin-shirley-mn0000769303">Kevin Shirley</a> . Lyrically detailed story ballads about the trials and tribulations of love, with an emphasis on broken relationships, remain his strong suit as song titles such as "Sadder Days," "Fix This," "I''ll Always Remember You," "Won''t Be Coming Home," and even the album''s title imply. Yet there are enough change-ups and excellent songs here to keep the pace varied. Horns that <a class="name-link" href="http://www.allmusic.com/artist/cray-mn0000830425">Cray</a> hasn''t utilized in a while make a welcome appearance on a few key tunes such as the big-band swing of "I''ll Always Remember You" (which seems'),
('One Kind Favor', '2008-08-26', 12, 'Blues,', 15.2, 'http://cps-static.rovicorp.com/3/JPG_400/MI0000/812/MI0000812177.jpg?partner=allrovi.com', '<p> It''s been so long since <a class="name-link" href="http://www.allmusic.com/artist/bb-king-mn0000059156">B.B. King</a> stepped outside of his comfort zone that <a class="album-link" href="http://www.allmusic.com/album/one-kind-favor-mw0000794719">One Kind Favor</a> comes as a bit of a shock. Unlike so many albums he''s cut in the wake of the crossover success of <a class="album-link" href="http://www.allmusic.com/album/the-thrill-is-gone-mw0000613789">The Thrill Is Gone</a> way back in 1970, the sound is stripped-back, not splashy, there is not a reliance on guest stars, and the repertoire is pure blues -- and these are all songs that he''s never recorded before, including three tunes by his longtime idol <a class="name-link" href="http://www.allmusic.com/artist/lonnie-johnson-mn0000275401">Lonnie Johnson</a> . Credit for the concept must be given to producer <a class="name-link" href="http://www.allmusic.com/artist/t-bone-burnett-mn0000743615">T Bone Burnett</a> , who applies a similar neo-rootsy aesthetic to <a class="album-link" href="http://ww'),
('Passion and Warfare', '2009-11-24', 14, 'Pop/Rock,', 45.2, 'http://cps-static.rovicorp.com/3/JPG_400/MI0001/584/MI0001584061.jpg?partner=allrovi.com', '<p> Widely acclaimed as his best album, <a class="album-link" href="http://www.allmusic.com/album/passion-and-warfare-mw0000308521">Passion and Warfare</a> finds <a class="name-link" href="http://www.allmusic.com/artist/steve-vai-mn0000045475">Steve Vai</a> coming into his own as a composer, as well as bypassing vocals almost entirely. His style isn''t quite as derivative of influences <a class="name-link" href="http://www.allmusic.com/artist/frank-zappa-mn0000138699">Frank Zappa</a> and <a class="name-link" href="http://www.allmusic.com/artist/joe-satriani-mn0000805785">Joe Satriani</a> as it was six years earlier on <a class="album-link" href="http://www.allmusic.com/album/flex-able-mw0000196197">Flex-able</a> ; while some of <a class="name-link" href="http://www.allmusic.com/artist/vai-mn0000045475">Vai</a> ''s sense of humor is still evident on tracks like the cock rock strut of "The Audience Is Listening," it is mostly replaced by a spiritual reflectiveness on ballads like "For the Love of God" and "Blue Powder" and dignified, committed rockers '),
('Planet Pit', '2011-06-21', 12, 'Latin,R&B,Rap,', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/187/MI0003187059.jpg?partner=allrovi.com', '<p> Returning to English after his Spanish-language album <a class="album-link" href="http://www.allmusic.com/album/armando-mw0001980717">Armando</a> , Miami-based rapper <a class="name-link" href="http://www.allmusic.com/artist/pitbull-mn0001845827">Pitbull</a> goes overboard with the gloss on <a class="album-link" href="http://www.allmusic.com/album/planet-pit-mw0002071134">Planet Pit</a> and winds up with a slick club monster that just gushes with good times. Solid hooks, polished production, cutting-edge tricks, and a star-studded guest list makes this a blockbuster thrill ride, but the reason <a class="album-link" href="http://www.allmusic.com/album/planet-pit-mw0002071134">Planet Pit</a> retains its sense of fun through repeated listens is the man_?_s cool charisma and cheeky attitude. _??Mommy, no you can_?_t go left/_?_Cause you look so right_?? and _??I_?_m such a dirty, dirty dog/My teeth will unsnap your bra_?? both figure into the gimmicky highlight _??Pause_?? while _??Got it locked-up, like Lindsey Lohan_?? is the best celebrity quip '),
('Red', '2012-10-22', 16, 'Country,Pop/Rock,', 65.23, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/438/MI0003438979.jpg?partner=allrovi.com', '<p> Alone among her peers, <a class="name-link" href="http://www.allmusic.com/artist/taylor-swift-mn0000472102">Taylor Swift</a> appears genuine. Which isn''t to say she''s without affectation or that she avoids artifice. She uses both when it suits her, as any real pop star would -- and if her 2012 album <a class="album-link" href="http://www.allmusic.com/album/red-mw0002414735">Red</a> intends to do anything, it''s to prove <a class="name-link" href="http://www.allmusic.com/artist/taylor-mn0000472102">Taylor</a> is a genuine superstar, the kind who transcends genre, the kind who can be referred to by a single name. Uneven as it is -- and it is, running just a shade too long as it sprints along in its quest to be everything to everyone -- <a class="album-link" href="http://www.allmusic.com/album/red-mw0002414735">Red</a> accomplishes this goal with ease, establishing <a class="name-link" href="http://www.allmusic.com/artist/taylor-swift-mn0000472102">Taylor Swift</a> as perhaps the only genuine cross-platform superstar of her time. Naturally, in orde'),
('She Wolf', '2009-11-23', 13, 'Latin,Pop/Rock,R&B,', 33, 'http://cps-static.rovicorp.com/3/JPG_400/MI0002/915/MI0002915675.jpg?partner=allrovi.com', '<p> Last time around, <a class="name-link" href="http://www.allmusic.com/artist/shakira-mn0000790797">Shakira</a> touched upon so many styles she couldn_?_t be contained on one album, splitting <a class="album-link" href="http://www.allmusic.com/album/oral-fixation-mw0000773317">Oral Fixation</a> in two. This time, she focuses on one sound only: a pulsating electro-disco that crosses all boundaries and welcomes all nationalities. Such concentration behooves <a class="name-link" href="http://www.allmusic.com/artist/shakira-mn0000790797">Shakira</a> , freeing her to release her inner <a class="album-link" href="http://www.allmusic.com/album/she-wolf-mw0001762399">She Wolf</a> , a wild wacko who_?_s as cuckoo as she is carnal. And for as sexy as <a class="name-link" href="http://www.allmusic.com/artist/shakira-mn0000790797">Shakira</a> is -- crucially, her music is sexy too -- what really gives <a class="album-link" href="http://www.allmusic.com/album/she-wolf-mw0001762399">She Wolf</a> its bite is her inspired nuttiness, how she laments that Matt Dam'),
('Speak Now', '2010-10-25', 14, 'Country,Pop/Rock,', 39, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/035/MI0003035816.jpg?partner=allrovi.com', '<p> When <a class="name-link" href="http://www.allmusic.com/artist/kanye-west-mn0000361014">Kanye West</a> bum-rushed <a class="name-link" href="http://www.allmusic.com/artist/taylor-swift-mn0000472102">Taylor Swift</a> _?_s acceptance speech at the 2009 VMAs, the world rallied around <a class="name-link" href="http://www.allmusic.com/artist/swift-mn0000472102">Swift</a> not because <a class="name-link" href="http://www.allmusic.com/artist/kanye-mn0000361014">Kanye</a> was a _??jackass,_?? as <a class="name-link" href="http://www.allmusic.com/artist/president-obama-mn0001011538">President Obama</a> so succinctly summarized, but because the singer/songwriter conveyed the fragility of adolescence on her 2008 breakthrough, <a class="album-link" href="http://www.allmusic.com/album/fearless-mw0000813082">Fearless</a> , so successfully that she inspired instinctive protectiveness even among those who never spent much time with the record. Not timid or a tart, <a class="name-link" href="http://www.allmusic.com/artist/swift-mn0000472102">Swift</a> seemed l'),
('The 20/20 Experience - 2 of 2', '2013-09-30', 11, 'Pop/Rock,R&B,', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/624/MI0003624384.jpg?partner=allrovi.com', '<p> Just before the release of <a class="album-link" href="http://www.allmusic.com/album/the-20-20-experience-mw0002491699">The 20/20 Experience</a> , <a class="name-link" href="http://www.allmusic.com/artist/the-roots-mn0000415906">the Roots</a> '' <a class="name-link" href="http://www.allmusic.com/artist/uestlove-mn0000505846">?uestlove</a> , who opened as a DJ for <a class="name-link" href="http://www.allmusic.com/artist/justin-timberlake-mn0000312890">Justin Timberlake</a> ''s SXSW festival appearance, announced that there would be a sequel. A little more than six months later, it was released, consisting of more recordings from <a class="name-link" href="http://www.allmusic.com/artist/timberlake-mn0000312890">Timberlake</a> ''s May-June 2012 sessions with friend <a class="name-link" href="http://www.allmusic.com/artist/timbaland-mn0000602378">Timbaland</a> , <a class="name-link" href="http://www.allmusic.com/artist/jerome-harmon-mn0003144340">Jerome Harmon</a> , and <a class="name-link" href="http://www.allmusic.com/artist/james-fauntleroy-mn0000'),
('The Fame', '2008-10-28', 13, 'Pop/Rock', 26, 'http://cps-static.rovicorp.com/3/JPG_400/MI0002/010/MI0002010423.jpg?partner=allrovi.com', '<p> The times were crying out for a pop star like <a class="name-link" href="http://www.allmusic.com/artist/lady-gaga-mn0000994823">Lady GaGa</a> -- a self-styled, self-made shooting star, one who mocked the tabloid digital age while still wanting to wallow in it -- and one who''s smart enough to pull it all off, too. That self-awareness and satire were absent in the pop of the new millennium, where even the best of the lot operated only on one level, which may be why <a class="name-link" href="http://www.allmusic.com/artist/lady-gaga-mn0000994823">Lady GaGa</a> turned into such a sensation in 2009: everybody was <em>thirsty</em> for music like this, music for and about their lives, both real and virtual. To a certain extent, the reaction to <a class="album-link" href="http://www.allmusic.com/album/the-fame-mw0001327294">The Fame</a> may have been a little too enthusiastic, with <a class="name-link" href="http://www.allmusic.com/artist/gaga-mn0000994823">GaGa</a> turning inescapable sometime in the summer of 2009, when she appeared on countless maga'),
('The Fame Monster', '2009-11-23', 8, 'Pop/Rock', 23.15, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/139/MI0003139570.jpg?partner=allrovi.com', '<p> Initially planned solely as a standard double-disc reissue in the wake of the blockbuster success of <a class="album-link" href="http://www.allmusic.com/album/the-fame-mw0001327294">The Fame</a> , <a class="name-link" href="http://www.allmusic.com/artist/lady-gaga-mn0000994823">Lady Gaga</a> decided to release the new material as a separate EP called <a class="album-link" href="http://www.allmusic.com/album/the-fame-monster-mw0001947970">The Fame Monster</a> in addition to the standard two-CD set, where it_?_s tacked onto a now standardized version of her debut. It_?_s a nice move for fans, plus it helps emphasize the new material, which does act as a bridge from the debut to a forthcoming full-length. Everything on <a class="album-link" href="http://www.allmusic.com/album/the-fame-monster-mw0001947970">The Fame Monster</a> bears a galvanized Eurotrash finish, as evident on the heavy steel synths of _??Bad Romance_?? and the updated <a class="name-link" href="http://www.allmusic.com/artist/abba-mn0000922728">ABBA</a> revision _??Alejandro,_?? a'),
('The Story of Light', '2012-08-14', 12, 'Jazz,Pop/Rock,Blues,', 29, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/416/MI0003416206.jpg?partner=allrovi.com', '<p> Guitar virtuoso <a class="name-link" href="http://www.allmusic.com/artist/steve-vai-mn0000045475">Steve Vai</a> ''s music has its roots in some unknown interstellar worlds. From his earliest mid-''80s solo output, <a class="name-link" href="http://www.allmusic.com/artist/vai-mn0000045475">Vai</a> ''s largely instrumental tricked-out guitar compositions found some strange middle ground between heavy metal bliss and space-traveling experimentalism. Released in 2005, <a class="album-link" href="http://www.allmusic.com/album/real-illusions-reflection-mw0000261218">Real Illusions: Reflection</a> found <a class="name-link" href="http://www.allmusic.com/artist/vai-mn0000045475">Vai</a> shifting from his alien undercurrents to a more spiritual vibe, with themes of new age discovery and introspection filling the album. <a class="album-link" href="http://www.allmusic.com/album/the-story-of-light-mw0002395751">The Story of Light</a> , <a class="name-link" href="http://www.allmusic.com/artist/vai-mn0000045475">Vai</a> ''s eighth studio album of solo work, cont'),
('The Union', '2010-10-19', 14, 'Pop/Rock,', 55, 'http://cps-static.rovicorp.com/3/JPG_400/MI0002/992/MI0002992114.jpg?partner=allrovi.com', '<p> On the inaugural episode of <a class="name-link" href="http://www.allmusic.com/artist/elvis-costello-mn0000058549">Elvis Costello</a> _?_s talk show <em>Spectacle</em> in 2008, <a class="name-link" href="http://www.allmusic.com/artist/elton-john-mn0000796734">Elton John</a> -- who just happened to be a producer on the show -- rhapsodized at length about <a class="name-link" href="http://www.allmusic.com/artist/leon-russell-mn0000816387">Leon Russell</a> , hauling out a note-perfect impression of <a class="name-link" href="http://www.allmusic.com/artist/russell-mn0000816387">Russell</a> _?_s piano style and Oklahoma drawl. It was enough of a tease to whet the appetite for more but nothing suggested something like <a class="album-link" href="http://www.allmusic.com/album/the-union-mw0002026440">The Union</a> , a full-fledged duet album with <a class="name-link" href="http://www.allmusic.com/artist/russell-mn0000816387">Russell</a> designed to raise the profile of the rock &amp; roll maverick. Like all lifers, <a class="name-link" href="http://www'),
('Tomahawk Technique', '2012-01-30', 12, 'Reggae,Pop/Rock,', 39, 'http://cps-static.rovicorp.com/3/JPG_400/MI0003/319/MI0003319738.jpg?partner=allrovi.com', '<p> During the 2011-2012 seasons, the wonderfully fickle dancehall fan base had revived <a class="name-link" href="http://www.allmusic.com/artist/shaggy-mn0000156938">Shaggy</a> as their superstar of choice, leaving less room for the swaggering <a class="name-link" href="http://www.allmusic.com/artist/sean-paul-mn0000264350">Sean Paul</a> . Maybe that?s why the slick <a class="album-link" href="http://www.allmusic.com/album/tomahawk-technique-mw0002298749">Tomahawk Technique</a> feels like a play for the world with its <a class="name-link" href="http://www.allmusic.com/artist/black-eyed-peas-mn0000091983">Black Eyed Peas</a> and <a class="name-link" href="http://www.allmusic.com/artist/flo-rida-mn0000921924">Flo Rida</a> -styled club tracks, the best of which has to be the slow-stepping "Got 2 Luv U," where <a class="name-link" href="http://www.allmusic.com/artist/paul-mn0000264350">Paul</a> and <a class="name-link" href="http://www.allmusic.com/artist/alexis-jordan-mn0002474811">Alexis Jordan</a> shout sweet nothings over a <a class="name-link" hr');
